import logo from "../../images/logo.svg"
export default function Header({ link }) {
    return (
        <header className="header">
            <img
                className="header__logo"
                src={logo}
                alt="Логотип Место"
            />
            (link && <h1>
              {{ link }}
            </h1>)
        </header>
    )
}
